import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first video container to be available
    await page.waitForSelector('div.video-container[data-video-id="1"]');

    // Click the bookmark button within the first video container
    await page.click('div.video-container[data-video-id="1"] .bookmark-btn');

    // Take a screenshot after clicking the bookmark button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_bookmark_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_bookmark_clicked.png'));

    // Verify if the bookmark action was successful (this could be based on UI changes or alerts)
    const bookmarkSuccess = await page.evaluate(() => {
      // Check if the bookmark button has changed state or if a success message is displayed
      const bookmarkButton = document.querySelector('div.video-container[data-video-id="1"] .bookmark-btn');
      return bookmarkButton && bookmarkButton.classList.contains('bookmarked'); // Example condition
    });

    return {
      success: bookmarkSuccess,
      action: "First video bookmarked successfully",
      extractedData: { videoId: 1, bookmarked: bookmarkSuccess },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

